    font-weight: 500;
    font-size: 42px;
    line-height: 49px;
}
@mixin maneFontDesktop {
    font-family: $manefont;
    font-weight: 500;
    font-size: 26px;
    line-height: 30px;
}
@mixin addictionalFontDesktop {
    font-family: $manefont;
    font-weight: 400;
    font-size: 20px;
    line-height: 23px;
