    background-size: cover;
    width: 100%;
    color: #fff;
    z-index: 0;
    height: 100vh;
    position: relative;
    z-index: 1;
    &::after{
        content: '';
        position: absolute;
        width: 100%;
        height: 100%;
        top: 0;
        left: 0;
        background-color: #000;
        opacity: 50%;
        z-index: 0;
    }
}
